# 예상 알고리즘: 구현
# 베스트 알고리즘: 구현

def solution(msg):
    answer = []
    dictionary = {chr(x): x - ord('A') + 1 for x in range(ord('A'), ord('Z')+1)}
    idx = 27
    L = len(msg)
    m = 0
    while m < L:
        curr = msg[m]
        temp = ''
        while curr in dictionary: 
            temp += msg[m]
            m += 1
            if m == L:
                break
            curr += msg[m]
        answer.append(dictionary[temp])
        dictionary[curr] = idx
        idx += 1
    return answer


print(solution("KAKAO"))
print(solution("TOBEORNOTTOBEORTOBEORNOT"))
print(solution("ABABABABABABABAB"))
print(solution(	""))
